import React, { useState } from 'react';

import AddToDo from '../components/add-to-do';

const Index = () => {
  const [todolist, setTodo] = useState([]);

  return (
    <>
      <AddToDo setTodo={(todolist, setTodo)} />
    </>
  );
};

export default Index;
